INSERT INTO `method` (`method_id`, `method`, `recipe_id`, `created_at`, `updated_at`) VALUES
(169, 'Heat oven to 240C/220C fan/gas 9. In a food processor, combine the flour, eggs, milk, mustard and some salt and pepper, blitz until smooth, then leave to rest for 30 mins.', 74, '2019-02-23 13:07:54', '2019-02-23 13:07:54'),
(170, 'Pour the oil into a metal roasting tin about 30 x 23cm and 7.5cm deep. Brush the oil all over the sides and bottom, then place in the oven. When the roasting tin is very hot and smoking, place the sausages inside, evenly spread out, and cook for 5 mins.', 74, '2019-02-23 13:07:54', '2019-02-23 13:07:54'),
(171, 'Give the rested batter a stir and pour into the really hot tin – take care as it may spit. Quickly sprinkle over the sage leaves and rosemary, then place in the middle of the oven. Do not open the door for 25 mins, then check – if needed, cook for a further 5-10 mins. Cook until puffed up and brown and the batter is completely cooked through. Serve straight from the dish.', 74, '2019-02-23 13:07:54', '2019-02-23 13:07:54'),
(184, 'Heat oven to 200C/fan 180C/gas 6. Cook the sweet potatoes in boiling, salted water for about 10 mins or until just tender when pierced with a knife. Meanwhile, mix together the butter with the garlic, harissa, lemon zest, chopped coriander and some seasoning. When the potatoes are ready, drain thoroughly, mash with the ginger and seasoning, then keep warm.', 79, '2019-02-25 10:49:33', '2019-02-25 10:49:33'),
(185, 'Place the fish in a roasting tin, season, then spread half the flavoured butter over each fillet. Roast for about 8 mins until just cooked through. Serve with the ginger mash and some green veg.', 79, '2019-02-25 10:49:33', '2019-02-25 10:49:33'),
(186, 'Rinsing and soaking your rice is key to achieving the perfect texture. Measure the rice into a bowl, cover with cold water, then use your fingers to massage the grains of rice – the water will become cloudy. Drain and rinse again with fresh water. Repeat five more times until the water stays clear.', 80, '2019-02-25 23:01:24', '2019-02-25 23:01:24'),
(187, 'Tip the rinsed rice into a saucepan with 400ml water, or 200ml dashi and 200ml water, bring to the boil, then turn down the heat to a low simmer, cover with a tight-fitting lid with a steam hole and cook for 15 mins. Remove from the heat and leave to sit for another 15 mins, then stir through the mirin. Remove the lid and give it a good stir. Serve with any or all of the optional toppings.', 80, '2019-02-25 23:01:24', '2019-02-25 23:01:24'),
(188, 'To make the glaze, put the Guinness, honey and sugar into a pan. Reduce by almost half to form a sweet syrupy glaze, then allow to cool.', 81, '2019-02-26 07:13:23', '2019-02-26 07:13:23'),
(189, 'Heat oven to 200C/fan 180C/gas 6. Season the pork with pepper and salt, if you want, place on a baking tray and roast for 20 mins. Then turn the heat down to 160C/fan 140C/gas3. Remove the pork from the oven and brush all over with most of the glaze (reserving a few tbsp) cook for a further 40-50 mins, brushing and basting the pork as it cooks until it’s beautifully caramelised and glazed.', 81, '2019-02-26 07:13:23', '2019-02-26 07:13:23'),
(190, 'Remove the pork from the roasting tray and leave to rest. Pour the remaining glaze into the roasting tray, then add the wine, Champagne or water. Place the pan on the heat and bring everything to the boil, simmer for a few mins until you have thick gravy. Carve pork into thin slices and place on top of the colcannon (see separate recipe). Glaze with the Guinness syrup, drizzle a little on the plates and finish with a sprig of parsley.', 81, '2019-02-26 07:13:23', '2019-02-26 07:13:23'),
(193, 'In a large microwave proof bowl, cover the bulgur wheat with stock. Cover with cling film and microwave on High for 4 mins. Set aside, covered; it will absorb the stock within another 5 mins. Make a dressing with spice mix, lemon zest and juice and olive oil, then season to taste. Add the onion, chickpeas, peppers and coriander, toss through the cooked bulgur wheat and serve warm or cold.', 83, '2019-02-26 07:46:17', '2019-02-26 07:46:17'),
(194, 'Heat the oil in a large saucepan, then fry the onion and celery gently for 10 mins until softened, stirring frequently. Tip in the cumin and fry for another min.', 84, '2019-02-26 07:51:58', '2019-02-26 07:51:58'),
(195, 'Turn up the heat, then add the stock, tomatoes and chickpeas, plus a good grind of black pepper. Simmer for 8 mins. Throw in broad beans and lemon juice, cook for a further 2 mins. Season to taste, then top with a sprinkling of lemon zest and chopped herbs. Serve with flatbread.', 84, '2019-02-26 07:51:58', '2019-02-26 07:51:58'),
(196, 'Heat the oil in a medium-size, lidded saucepan. Add the ginger and garlic, then stir-fry for about 5 mins. Add the squash, soy sauce, sugar and stock. Cover, then simmer for 10 mins. Remove the lid, add the green beans, then cook for 3 mins more until the squash and beans are tender. Stir the spring onions through at the last minute, then sprinkle with coriander and serve with rice.', 86, '2019-02-26 08:01:15', '2019-02-26 08:01:15');
